        console.log(this.props);
        console.log(this.props.key);
        return(
            <div className="image_div">
                {/* <label name={topText} value={props.topText}>{props.topText}</label> */}
                <img className="img_tag" src={this.props.src} alt={this.props.name} key={this.props.id} />
                {/* <label name={bottomText} value={props.bottomText}>{props.bottomText}</label> */}
            </div>
        )
    }
}
